        <span className="d-block p-2 bg-primary text-white .d-print-block">
        <ul className="pagination center pin-bottom">
          <PaginationElement element="React"/>
          <PaginationElement element="Angular"/>
          <PaginationElement element="JAVA"/>
          <PaginationElement element="Python"/>
          <PaginationElement element="C"/>
        </ul>
      </span>
    )
}

export default Pagination
